model.basedosdados.mundo_transfermarkt_c.description:
Dados de 2003-03-29 até 2006-12-03 possuem somente as seguintes informações: data, horario, rodada, estadio, time_mandante, time_visitante, gols_mandante, gols_visitante. O motivo é que o site não disponibilizou outras informações.
A partir de 2007-05-03, informações mais completas foram disponibilizadas, contudo com algumas exceções. - tecnico_mandante e tecnico_visitante possuem alguns valores vazios devido a mudança de padrão. Geralmente técnicos possui id = 0. Contudo quando o técnico é um ex-jogador, ele possuí um id específico. Em consequência da inconsistência no padrão do id dos técnicos, linhas em que esse erro ocorre as colunas valor_equipe_titular_mandante, valor_equipe_titular_visitante, idade_media_titular_mandante, idade_media_titular_visitante, também são afetadas e resultando em vazio; - Na data de 2016-12-11, rodada 38, a partida entre Chapecoense e Atlético-MG não ocorreu em decorrência do desastre que atingiu a equipe do Chapecoense na época, resultando assim em W.O. duplo;
Fonte: https://www.transfermarkt.com/campeonato-brasileiro-serie-a/startseite/wettbewerb/BRA1
